import React from 'react';
import '../../tableDisplayCss.css';

class MachineWorkTable extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div id="tableComponent">
                <div className="row upperTable">
                    <div className="col-sm-5">
                        <blockquote className="commonFont blockquote text-center">
                            <p className="mb-0">Mahesh Party</p>
                            //<footer className="blockquote-footer"> 7742879818</footer>
                        </blockquote>                        
                    </div>

                    <div className="col-sm-3">
                    <blockquote className="commonFont blockquote text-center">
                        <label className="radio-inline">
                            <input type="radio" name="optradio" checked />paid
                        </label>
                        <label className="radio-inline">
                            <input type="radio" name="optradio" />unpaid
                        </label>                    
                        </blockquote>                        
                    </div>


                    <div className="col-sm-2">
                        <label className="commonFont d-inline">From</label>
                        <input type="date" />
                    </div>

                    <div className="col-sm-2">
                        <label className="commonFont d-inline">To</label>
                        <input type="date" />
                    </div>
                </div>
                <div id="midTable"></div>
                <div id="lowerTable"></div>
            </div>
        );
    }
}

export default MachineWorkTable;
